	add("defamiliarisation", "{\"term\":\"defamiliarisation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Possibly a calque of the Russian остранение \u0027(ostranenie)\u0027 as used by w:Viktor Shklovsky|Viktor Shklovsky.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The representation of objects anew, in a way that we do not recognize, or that changes our reading of them\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1991,\u0027\u0027 Antony Easthope, \u0027Literary Into Cultural Studies\u0027 [http://print.google.com/print?hl\u003den\u0026amp;id\u003dvqAj0z2OogUC\u0026amp;pg\u003dPA55\u0026amp;lpg\u003dPA55\u0026amp;dq\u003ddefamiliarisation+ostranenie\u0026amp;sig\u003ddPoDPBf2_VWzl1mRmIxiq-RYLdc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It therefore works via a process of ‘\u0027\u0027defamiliarisation\u0027\u0027’ (\u0027ostranenie\u0027) (Shklovsky instances \u0027\u0027defamiliarisation\u0027\u0027 as an effect to be found in riddles with their play on words, and in euphemistic references to erotic subjects\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1991,\u0027\u0027 Brian A. Connery, “Inside Jokes: Familiarity and Contempt in Academic Satire,” in \u0027University Fiction,\u0027 David Bevan, ed. [http://print.google.com/print?id\u003dAqgTPo_L9OwC\u0026amp;pg\u003dPA126\u0026amp;lpg\u003dPA126\u0026amp;sig\u003dz9me6_SmOJ-KxzKwlzMR3WYJI98\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Fourth, and finally, while postmodernist works like Lodge’s \u0027Changing Places\u0027 and \u0027Small World\u0027 give the impression of being satires, because of their self-conscious and rather thick use of parody as a means to \u0027\u0027defamiliarisation\u0027\u0027, along with their presentation of a humorous world, the satirical attack is actually deflected or blunted by the parody\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1996,\u0027\u0027 Andrew Bowie, \u0027From Romanticism to Critical Theory\u0027 [http://print.google.com/print?hl\u003den\u0026amp;id\u003dSTlj-RSkrXMC\u0026amp;pg\u003dPA5\u0026amp;lpg\u003dPA5\u0026amp;sig\u003dde6wyA3lCppZg6vHn7RRBSxgfAQ\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The fact that \u0027\u0027defamiliarisation\u0027\u0027 need not be understood solely in linguistic terms is evident in all kinds of aesthetic experience: for example, a painting or a piece of music can also be understood as ‘defamiliarising’ habitual perceptions\", \"priority\":7}]}, \"synonyms\":{}}");

